import Flash from "./components/Flash";
import HeaderOne from "./components/HeaderOne";
import HeaderThree from "./components/HeaderThree";

import HeaderTwo from "./components/HeaderTwo";

import ShippingOne from "./components/ShippingOne";
import ShippingThree from "./components/ShippingThree";
import ShippingTwo from "./components/ShippingTwo";
import FooterOne from "./components/FooterOne";
import Home from "./main_componenets/Home";
import Cart from "./main_componenets/Cart";
import Shop from "./main_componenets/Shop";
import MyAccount from "./main_componenets/MyAccount"

import './main.css'

function App() {
  return (
    <>
      <HeaderOne/>
      <HeaderTwo/>
      <HeaderThree/>
      <br/>

      <ShippingOne/>
      <ShippingTwo/>
      <ShippingThree/>
      <Flash/>

      <FooterOne/>

      <Home/> 
      <hr/>
      <hr/>
      <hr/>
      <hr/>
      <Shop/>
      <hr/>
      <hr/>
      <hr/>
      <hr/>
      <Cart/>
      <hr/>
      <hr/>
      <hr/>
      <hr/>
      <MyAccount/>





    </>
  );
}

export default App;
